$(function(){$("input[readOnly]").keydown(function(a){a.preventDefault()})});function newDate(b){b=b.replace(/-/g,"/");var a=new Date(b);return a}function formatDate(a){return(a.getFullYear())+"-"+formatNum(a.getMonth()+1)+"-"+formatNum(a.getDate())}function formatNum(a){var b=a+"";if(b.length==2){return b}else{return +"0"+b}};